support:
Услуга по содействию участию в закупках индивидуальным предпринимателям. Услуга предоставляется индивидуальному предпринимателю по следующим направлениям:
- консультирование по вопросам участия в закупках, предусмотренных преференциях в соответствии с действующим федеральных законодательством (Федеральный закон от 18 июля 2011 г. № 223-ФЗ
«О закупках товаров, работ, услуг отдельными видами юридических лиц», постановление Правительства Российской Федерации от 11 декабря 2014 г. № 1352 «Об особенностях участия субъектов малого и среднего предпринимательства в закупках товаров, работ, услуг отдельными видами юридических лиц»), а также по иным вопросам в целях содействия участию в закупках;
- информирование об обучающих программах в сфере закупок;
- подбор номенклатуры товаров, работ, услуг в виде графического и текстового описания.

. Услуга предоставляется индивидуальному предпринимателю по следующим направлениям:
- доработка/разработка фирменного стиля; 
- разработка, печать и изготовление POS материалов; 
- создание многостраничного сайта или лендинга; 
- дизайн презентации, медиа-кита; 
- разработка, изготовление рекламной продукции; 
- разработка, изготовление фото, -видеоконтента (промороликов)

Услуга по разработке сайтов, рекламной продукции, бренда самозанятым гражданам. Услуга предоставляется самозанятому гражданину по следующим направлениям:
- доработка/разработка фирменного стиля; 
- разработка, печать и изготовление POS материалов; 
- создание многостраничного сайта или лендинга; 
- дизайн презентации, медиа-кита; 
- разработка, изготовление рекламной продукции; 
- разработка, изготовление фото, -видеоконтента (промороликов)

